import { StyleSheet } from "react-native"

const style = StyleSheet.create({
    
  pagerStyle: {
    flex: 1,
    paddingTop: 20,
    backgroundColor: 'white',
  },
  flexContainer: {
      flexDirection: 'row',
      paddingHorizontal: 10,
  },
})

export default style;
